package com.hwk.leetCode;

public class RepeatedSubstringPattern {
	
	public static void main(String[] args) {
		
		long start = System.currentTimeMillis();
		System.out.println(repeatedSubstringPattern1(""));
		
		long start1 = System.currentTimeMillis();
		System.out.println(start1 - start);
		
		System.out.println(repeatedSubstringPattern(""));
		
		System.out.println(System.currentTimeMillis() - start1);
	}
	
	 public static boolean repeatedSubstringPattern(String s) {
	        int size = s.length();
	        
	        if(size == 1) {
	        	return false;
	        }
	        
	        if (s.split(String.valueOf(s.charAt(0))).length == 0) {
	            return true;
	        }
	        int r = size >> 1;
	        
		 	for(int i = 2; i <= r ; i ++) {
		 		if(size % i == 0) {
			 		String regex = s.substring(0, i);
			 		String t[] = s.split(regex);
			 		if(t.length == 0) {
			 			System.out.println(i);
			 			return true;
			 		}
		 		}
		 	}
		 
	        return false;
	    }
	 
	 public static boolean repeatedSubstringPattern1(String s) {
         if (s == null) {
            return false;
        }
        
        // 长度为1，不能拆分出子串，所以直接返回false
        if (s.length() == 1) {
            return false;
        }
        
        // 长度大于1，可以拆分出子串，判断字符串中是否所有字符都相同，如"aaaaaa","zzz"，一定满足按子串长度为1的拆分，所以直接返回true
        if (s.split(String.valueOf(s.charAt(0))).length == 0) {
            return true;
        }
        
        // 找长度最长的因子，拆分出子串
        for (int i = s.length() - 1;i >= 2;i--) {
            if (s.length() % i == 0) {
                String pattern = s.substring(0,i);
                String arr[] = s.split(pattern);
                if (arr.length == 0) {
                	System.out.println(i);
                    return true;
                }
            }
        }
        
        return false;
    }
}
